import React, { useState } from "react";
import "../styles/App.css";
import logo from "../logo.svg";
import schoolIcon from "../school-icon.svg";
import successIcon from "../wrong-icon-icon.svg"; // Replace with a green checkmark icon.

const ResetPassword = () => {
  const [password, setPassword] = useState("");
  const [passwordStrength, setPasswordStrength] = useState("");
  const [showModal, setShowModal] = useState(false);
  const [modalType, setModalType] = useState(""); // "success" or "error"

  const checkPasswordStrength = (value) => {
    setPassword(value);
    const strongPassword = /^(?=.*[A-Z])(?=.*[0-9!@#$%^&*])[A-Za-z0-9!@#$%^&*]{8,12}$/;
    if (strongPassword.test(value)) {
      setPasswordStrength("Strong");
    } else {
      setPasswordStrength("Weak");
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (passwordStrength === "Strong") {
      setModalType("success");
    } else {
      setModalType("error");
    }
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
  };

  return (
    <div className="reset-password-container">
      {/* Left Side */}
      <div className="reset-left">
        <div className="logo">
          <img src={logo} alt="PFE Logo" />
        </div>
        <img className="school-logo" src={schoolIcon} alt="ESI School Logo" />
      </div>

      {/* Right Side */}
      <div className="reset-right">
        <div className="reset-content">
          <h1>Reset password.</h1>
          <p>
            Simplify your PFE journey with an all-in-one platform to manage,
            track, and organize your final project.
          </p>
          <form onSubmit={handleSubmit}>
            <label>New password</label>
            <div className="password-field">
              <input
                type="password"
                value={password}
                onChange={(e) => checkPasswordStrength(e.target.value)}
                placeholder=""
                className="input-field"
              />
            </div>
            <p className={`password-strength ${passwordStrength.toLowerCase()}`}>
              Password strength: {passwordStrength || "Enter a password"}
            </p>
            <ul className="password-requirements">
              <li>
                {password.length >= 8 && password.length <= 12 ? "✓" : "✗"} Minimum 8-12 characters
              </li>
              <li>
                {/[A-Z]/.test(password) ? "✓" : "✗"} At least one uppercase letter
              </li>
              <li>
                {/[0-9!@#$%^&*]/.test(password) ? "✓" : "✗"} At least one number or symbol
              </li>
              <li>{!/\s/.test(password) ? "✓" : "✗"} Cannot contain spaces</li>
            </ul>
            <button type="submit" className="btn">
              Reset password
            </button>
          </form>
        </div>
      </div>

      {/* Modal */}
      {showModal && (
        <div className="modal-overlay">
          <div className={`modal ${modalType}`}>
            {modalType === "success" ? (
              <div className="modal-icon">
                <img src={successIcon} alt="Success" />
              </div>
            ) : (
              <div className="modal-header">✘ Error!</div>
            )}
            <div className="modal-header">
              {modalType === "success" ? "Success!" : "Error!"}
            </div>
            <div className="modal-body">
              {modalType === "success" ? (
                <p>
                  Your password has been updated! If you didn’t make this
                  change, please contact support immediately.
                </p>
              ) : (
                <p>
                  Something went wrong. Please check your connection and try
                  again. If the issue persists, contact support.
                </p>
              )}
            </div>
            <div className="modal-footer">
              <button onClick={closeModal} className="btn-primary">
                {modalType === "success" ? "Back to Login" : "Try Again"}
              </button>
              {modalType === "error" && (
                <button onClick={closeModal} className="btn-secondary">
                  Cancel
                </button>
              )}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default ResetPassword;
